import React from "react";
import ReactDom from "react-dom";
import Card from "./Card";
import Mdata from "./Mdata";
import Click from "./Click";
import "./index.css";



ReactDom.render(
  <>
  <h1 className="heading">Hotstar Specials & Latest Movies</h1>
    {Mdata.map((val) => {
    return(
      <Card 
        imgsrc={val.imgsrc}
        title={val.title}
        fname={val.fname}
        flink={val.flink}
      />
      );
    })}<br/>
    <Click/>
  </>, 
 document.getElementById("root")

);
